import React from 'react';
import { LineChart, XAxis, Tooltip, CartesianGrid, Line, ResponsiveContainer, AreaChart } from 'recharts';

export const Graph = () => {
  const data = [
    {name: 'Month 1', earn: 50},
    {name: 'Month 2', earn: 100},
    {name: 'Month 3', earn: 75},
    {name: 'Month 4', earn: 86},
    {name: 'Month 5', earn: 143},
    {name: 'Month 6', earn: 178},
    {name: 'Month 7', earn: 100},
  ];
  return <>
    <ResponsiveContainer style={{ width: '100%', height: 300 }}>
      <AreaChart
        data={data}
        margin={{ top: 5, right: 20, left: 10, bottom: 5 }}
      >
        <XAxis dataKey="name" />
        <Tooltip />
        <CartesianGrid strokeDasharray="3 3" stroke="#f5f5f5" />
        <Line type="monotone" dataKey="earn" stroke="#ff7300" yAxisId={0} />
      </AreaChart>
    </ResponsiveContainer>
  </>;
};
